import CardVideo from "../CardVideo"
import { MenuVertical } from "../MenuVertical/MenuVertical";

export function MainContent(props){
  return(
    <MainContainer>
      <MenuVertical />

      <section className="painel-de-videos">
        <CardVideo
          image1={props.image1}
          titulo={props.titulo}
          textoAlternativo={props.textoAlternativo}
        />
      </section>
    </MainContainer>

  );
}
